content:
@david_flood @RoisinGarvey Oil and gas are instruments of mass influence. Look at what's happening with Russia throttling gas in a scheme to eventually isolate Ukraine.

Those who control the flows, control the world.

As for Brits tapping our cables, on balance, that's probably in our interest.

